import React from 'react';
import {
    Anchor,
    Button,
    Header,
    Nav,
    Text,
} from 'grommet';
import {
    Link,
}from "react-router-dom";
import { FaPaw } from 'react-icons/fa';

const AppHeader = ()  => {
    return(
<Header background="light-4" pad="small">
        <Text weight="bold">Fluff Finder
        <FaPaw />
        </Text>
      <Nav direction="row">
          <Link to="/login">
        <Anchor label="Log in" href="#" color="#5c8001" />
        </Link>
        <Link to="/signup">
        <Button label="Sign up"  color="#5c8001"/>
        </Link>
      </Nav>
    </Header>  
    )
};

export default AppHeader;
